import { useMemo } from "react";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  Filler,
  ArcElement,
  RadialLinearScale,
} from "chart.js";
import { Radar} from "react-chartjs-2";

ChartJS.register(
  ArcElement,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  RadialLinearScale,
  Title,
  Tooltip,
  Legend,
  Filler
);

const supply = [2326,3435, 1245, 1452, 5643, 3274, 5346, 1224, 2245,4232,3221,553];
const electricity = [1623,2115, 2213, 2325, 4223,2154, 6249, 7324, 6125,4524,2221,3211];
const labels = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul","Aug","Sep","Oct","Nov","Dec"];

const options = {
  fill: true,
  responsive: true,
  scales: {
    y: {
      min: 0,
    },
  },
  plugins: {
    legend: {
      display: true,
    },
    title: {
      display: true,
      text: 'Regional Budget 2022'
    }
  },
};

export default function LineChart2() {
  const data = useMemo(function () {
    return {
      datasets: [
        {
          label: "Supply",
          data: supply,
          borderColor: "#2a9d8f",
          backgroundColor: "rgba(0,0,0,0)",
        },

        {
          label: "Eleciricity",
          data: electricity,

          borderColor:"#f4a261",
          backgroundColor:"rgba(0,0,0,0)",

        },
      ],
      labels,
    };
  }, []);

  return <Radar data={data} options={options} />;
}
